import React, { useState } from "react";
import logo from './assets/img/logo-soon.png'
import tres from './assets/img/tres.png'
import { Hoc } from "./Hoc";
// WinnersComponent

function IndexPage() {

  return (
    <div className="content soon">
      <div className="flex flex-col items-center py-8">
        <div className="logo ">
          <img src={logo} alt="" />
        </div>
        <div className="tresnutye max-w-3xl	mt-8">
          <img src={tres} alt="" />
        </div>
        <div className="timer"></div>
      </div>
    </div>
  );

}

export default Hoc(IndexPage);
